import React from "react";
import { useTheme } from "@material-ui/styles";
import ApexCharts from "react-apexcharts";

const series = [
  {
    name: "row1",
    data: [0],
      min: 0,
      max: 1,
  },
  { 
    name: "row2",
    data: [0],
      min: 0,
      max: 1,
  },
  { 
    name: "row3",
    data: [0],
      min: 0,
      max: 1,
  },
  { 
    name: "row4",
    data: [0],
      min: 0,
      max: 1,
  },
  { 
    name: "row5",
    data: [0],
      min: 0,
      max: 1,
  },
  { 
    name: "row6",
    data: [0],
      min: 0,
      max: 1,
  },
  { 
    name: "row7",
    data: [0],
      min: 0,
      max: 1,
  },
  {
    name: "row8",
    data: [0],
      min: 0,
      max: 1,
  },
];



export default function ApexLineChart(props) {
  var theme = useTheme();

  const series2 = [
  {
    name: "row1",
    data: props.data[0]
  },
  {
    name: "row2",
    data: props.data[1]
  },
  {
    name: "row3",
    data: props.data[2]
  },
  {
    name: "row4",
    data: props.data[3]
  },
  {
    name: "row5",
    data: props.data[4]
  },
  {
    name: "row6",
    data: props.data[5]
  },
  {
    name: "row7",
    data: props.data[6]
  },
  {
    name: "row8",
    data: props.data[7]
  },
  ];

  const options2 = {
    chart: {
      toolbar: {
        show: false,
      },
    },
    dataLabels: {
      enabled: false,
    },
    colors: ["#008FFB"],
  }

  return (
    <ApexCharts
      options={options2}
      series={series2}
      type="heatmap"
      height={350}
    />
  );
}

// ##################################################################
function generateData(count, yrange) {
  var i = 0;
  var series = [];
  while (i < count) {
    var x = "w" + (i + 1).toString();
    var y =
      Math.floor(Math.random() * (yrange.max - yrange.min + 1)) + yrange.min;

    series.push({
      x: x,
      y: y,
    });
    i++;
  }

  return series;
}

function themeOptions(theme) {
  return {
    chart: {
      toolbar: {
        show: false,
      },
    },
    dataLabels: {
      enabled: false,
    },
    colors: ["#008FFB"],
  };
}
